pub enum Reader<R> where R: std::io::Read + std::io::Seek {
    Flac(claxon::FlacReader<R>),
    OggVorbis(lewton::inside_ogg::OggStreamReader<R>),
    Wav(hound::WavReader<R>),
    CafAlac(super::caf_alac::AlacReader<R>),
}

pub enum ReadError {
    Io(std::io::Error),
    Reader(FormatError),
    UnsupportedFormat,
}
